import Particles from '@tsparticles/react';
import { loadAll } from '@tsparticles/all';
import './App.css';
function Aa() {
  const particlesInit = useCallback(async (engine) => {
    await loadAll(engine);
  }, []);

  return (
    <>
    <Particles
      id="tsparticles"
      init={particlesInit}
      options={{
        background: {
          color: { value: "black" } // White background
        },
        particles: {
          number: { value: 80 },
          color: "#000000", // Black particles
          size: 10,
          links: {
            enable: true,
            color: "white",
            distance: 150,
            width: 3,
          },
          move: {
            enable: true,
            speed: 10,
          },
        },
      }}
    />
